const fetch = require('node-fetch');

const Services = {
  async getWeather(locId) {
    console.log(locId);
    fetch("http://localhost:1337/user", { method: 'POST', body: {locId: locId}} )
      .then(res => res.text())
      .then(res => console.log(res));
  }
}

Services.getWeather(
  1
);
